import PropTypes from 'prop-types';
import classNames from 'classnames';

import Block from '../components/block';
import List from '../components/list';
import Link from '../components/link';

class Details extends React.Component {
  renderTravel() {
    return (
      <div className='details-travel'>
        <h4>Travel</h4>
        <Block blockTitle='Location'>
          <div>The Outdoor Art Club</div>
          <div>1 West Blithedale Avenue, Mill Valley CA</div>
          <List>
            <List.Item><Link linkTo=''>Get Directions</Link></List.Item>
          </List>
        </Block>
        <Block blockTitle='Accomodations'>
          If you're coming in from out of town, we recommend staying in Mill Valley or San Francisco. We can arrange a shuttle for you if you do stay in the city. Just let us know!
          <List>
            <List.Item><Link linkTo=''>Browse Airbnb</Link></List.Item>
            <List.Item><Link linkTo=''>Browse Mill Valley Inn</Link></List.Item>
          </List>
        </Block>
        <Block blockTitle='Parking'>
          The Outdoor Art Club doesn't have public parking but there is an outdoor lot one block away. It's only a 3-5 minute walk.
          <List>
            <List.Item><Link linkTo=''>Get Directions</Link></List.Item>
          </List>
        </Block>
        <style jsx>{`
          .details-travel {
            margin-bottom: 48px;
          }
          .details-travel h4 {
            margin-bottom: 24px;
          }
        `}</style>
      </div>
    )
  }

  renderRegistry() {
    return (
      <div className='details-registry'>
        <h4>Registry</h4>
        <Block blockTitle='Online'>
          This is entirely optional!
          <List>
            <List.Item><Link linkTo=''>Zola</Link></List.Item>
          </List>
        </Block>
        <style jsx>{`
          .details-registry h4 {
            margin-bottom: 24px;
          }
        `}</style>
      </div>
    )
  }
  render() {
    return (
      <div className='details'>
        { this.renderTravel() }
        <style jsx>{`
          .details {
            grid-area: details;
          }
        `}</style>
      </div>
    )
  }

}

export default Details
